import { VscChromeClose } from "react-icons/vsc";

import './BookList.css';

function BookList({books,Delete,handleEdit,editID}){
    return(
        <>
        <ul className="list">
            {books.map(book =>(
                <li key={book.id}>

                {book.title}
                <button id="edit" onClick={()=>handleEdit(book.id)}>Edit title</button>
                <VscChromeClose 
                style={{ color: 'red', fontSize: '18px', fontWeight: 'bolder'}} 
                onClick={()=>Delete(book.id)}/>
                </li>
            ))}
        </ul>
        </>

    );
}
export default BookList;
